import React from 'react';
import Wrapper from '../components/Wrapper';
import styles from '../style/actionMovie.module.scss';
import bg from "../img/bg.jpg";
import bg2 from "../img/bg2.jpg";
import bg3 from "../img/bg3.jpg";


export default function Contact() {
    return (
        <div className={styles.body}>
            <div className={styles.parent__presentaion_cards}>
                <div><img src={bg} alt="bg" className="w-100 rounded-2" /></div>
                <div> <img src={bg2} alt="bg" className="w-100 rounded-2" /></div>
                <div><img src={bg3} alt="bg" className="w-100 rounded-2" /></div>
            </div>
        </div>
    )
}
